SIALKOT, Feb 29 (APP)::Special Assistant to Prime Minister on Information and Broadcasting Dr Firdous Ashiq Awan will address a big public gathering at village Mandian Wala here on Sunday, March 1.
She will also inaugurate a gas supply project in Union Council Vario-Sialkot, her electoral constituency (NA 72, Sialkot-I).
